        <div id='search_area'>
            <input type="text" id='search_input' placeholder='请输入你想搜索的内容' />
            <button onClick={() => {
                props.getList(["搜索结果1", "搜索结果2", "搜索结果3"])
            }}>123</button>
        </div>
    )
}

